import React from 'react';
import { useParams } from 'react-router-dom';
import Iframe from 'react-iframe';

function TopicsVis() {
    const { fileName } = useParams();

    return (
        <Iframe url={`http://localhost:3000/topics-data/${fileName}.html`}
            width="100%"
            height="100%"
            display="initial"
            position="relative" />
    );
}

export default TopicsVis;
